async function addEnhancedGameDataToPicks(g,game,gs){try{if(!game||!game.away||!game.home)return;const wn=(typeof currentWeek!=='undefined')?currentWeek:(typeof window.currentWeek!=='undefined')?window.currentWeek:1;const eg=await window.espnApi.getWeekGames(wn);const espn=eg.find(e=>(e.a===game.away||e.awayTeam===game.away)&&(e.h===game.home||e.homeTeam===game.home));if(espn){const c=document.getElementById(`picks-espn-data-${g}`);if(c){let ed=[];if(espn.weather&&espn.weather.temperature){const ti=espn.weather.temperature>70?'â˜€ï¸':espn.weather.temperature>50?'ğŸŒ¤ï¸':espn.weather.temperature>32?'â˜ï¸':'â„ï¸';ed.push(`<div class="flex items-center gap-1 text-xs text-slate-600"><span class="text-sm">${ti}</span><span><strong>${espn.weather.temperature}Â°F</strong> ${espn.weather.condition||espn.weather.description||''}</span></div>`);}if(espn.venue&&espn.venue.name){const vi=espn.venue.indoor?'ğŸŸï¸':'ğŸŒ¤ï¸';const l=espn.venue.city&&espn.venue.state?` â€¢ ${espn.venue.city}, ${espn.venue.state}`:'';ed.push(`<div class="flex items-center gap-1 text-xs text-slate-600"><span class="text-sm">${vi}</span><span><strong>${espn.venue.name}</strong>${l}</span></div>`);}if(espn.broadcasts&&espn.broadcasts.length>0){const ns=espn.broadcasts.map(b=>b.network).filter(Boolean).join(', ');if(ns){const ipt=ns.includes('NBC')||ns.includes('ESPN')||ns.includes('FOX')||ns.includes('CBS');const tvi=ipt?'ğŸ“ºâ­':'ğŸ“º';ed.push(`<div class="flex items-center gap-1 text-xs text-slate-600"><span class="text-sm">${tvi}</span><span><strong>${ns}</strong>${ipt?' (Primetime)':''}</span></div>`);}}if(ed.length>0){c.innerHTML=`<div class="space-y-1">${ed.join('')}</div>`;c.classList.remove('hidden');}else{c.classList.add('hidden');}}}}catch(e){}}
